import React, { useState, useEffect } from "react";
import Axios from "axios";
function Main() {
  const [robotLists, setRobotLists] = useState([]);
  useEffect(() => {
    const response = Axios.get("http://localhost:3002/getPitStats");
    setRobotLists(response.data);
    console.log(robotLists);
  });
  return <div></div>;
}

export default Main;
